■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ソフトな肌ざわりのサポーター。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5212/4561bp-01.jpg" width="600" height="420"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【洗濯時の注意点】<br>・中性洗剤をご使用ください。<br>・ぬるま湯でお洗いください。<br>・陰干ししてください。 <br><br>【使用サイズについて】<br>本商品は横に伸びます。<br>使用する際の伸びは1.5倍とお考えください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="420" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5212/4561bp-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">筋肉痛・関節痛の予防に、通気性・保湿力に優れています。ソフトな肌ざわりで、長時間使用しても疲れません。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">筋肉痛・関節痛の予防に、通気性・保湿力に優れています。ソフトな肌ざわりで、長時間使用しても疲れません。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：10×20×3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ポリノジック(強力レーヨン)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">色:生成</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">1枚入×2</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.7--><style type="text/css">
